Since $\sin (180^\circ - x) =\sin x$ and $\cos (180^\circ - x) = -\cos x$ for any angle, we have $$\tan(180^\circ - x) =
\frac{\sin(180^\circ - x)}{\cos(180^\circ - x)} = \frac{\sin x}{-\cos x} = -\tan x$$for any angle for which $\tan x$ is defined.  Therefore, $\tan\angle BDC = -\tan\angle BDA$.

From the Pythagorean Theorem, we have $AC = \sqrt{BC^2 - BA^2} = 24$.  Since $D$ is the midpoint of $\overline{AC}$, we have $AD = AC/2 =12$.  Therefore, we have $\tan \angle BDC = -\tan \angle BDA = -\frac{BA}{AD} = \boxed{-\frac{7}{12}}$.

Since we know that $f(x)=x^3+2x+1$ and $g(x)=x-1$, we can express $f(g(1))$ as $(x-1)^3+2(x-1)+1$. Thus, when $x=1$ we find \begin{align*} (f(g(1))&=(1-1)^3+2(1-1)+1
\\ &=(0)^3+2(0)+1
\\ &=0+0+1
\\&=\boxed{1}
\end{align*}

problem:
The length of the diameter of this spherical ball is equal to the height of the box in which it is placed. The box is a cube and has an edge length of 30 cm. How many cubic centimeters of the box are not occupied by the solid sphere? Express your answer in terms of $\pi$. [asy]
draw(Circle((7.5,7.5),5));
draw((7.5,6.2)..(2.5,7.5)--(12.5,7.5)..cycle);
draw((7.5,8.8)..(2.5,7.5)--(12.5,7.5)..cycle,linetype("2 4"));
fill((2.6,7.4)--(2.6,7.6)--(12.4,7.6)--(12.4,7.4)--cycle,white);
dot((7.5,7.5));
draw((0,0)--(10,0)--(10,10)--(0,10)--cycle);
draw((0,10)--(5,15)--(15,15)--(10,10));
draw((15,15)--(15,5)--(10,0));
draw((0,0)--(5,5)--(15,5),dashed); draw((5,5)--(5,15),dashed);
[/asy]

solution:
Let $O$ be the center of the sphere, and assume for now that $O$ is inside polyhedron $P$. We can carve polyhedron $P$ into pyramids, each of which has a face of $P$ as its base and $O$ as its apex. For example, a cube would be carved into six pyramids, two of which are highlighted in this drawing: [asy]
size(4cm);
import three;
triple A,B,C,D,EE,F,G,H;
A = (0,0,0);
B = (1,0,0);
C = (1,1,0);
D= (0,1,0);
EE = (0,0,1);
F = B+EE;
G = C + EE;
H = D + EE;
O = G/2;
draw(surface(B--O--C--cycle),red,nolight);
draw(surface(C--O--D--cycle),red+white,nolight);
draw(surface(H--O--G--cycle),lightblue,nolight);
draw(surface(G--O--F--cycle),blue,nolight);
draw(surface(EE--F--G--H--cycle),lightblue+blue,nolight);
draw(B--C--D);
draw(B--A--D,dashed);
draw(EE--F--G--H--EE);
draw(A--EE,dashed);
draw(B--F);
draw(C--G);
draw(D--H);
draw(A--O--C,dashed);
draw(B--O--D,dashed);
draw(EE--O--G,dashed);
draw(F--O--H,dashed);
dot(A); dot(B); dot(C); dot(D); dot(EE); dot(F); dot(G); dot(H); dot(O);
label("$O$",O,WSW);
[/asy] Then if we add up the areas of all the pyramids' bases, we get the surface area of $P$. If we add up the volumes of the pyramids, we get the volume of $P$.

The volume of each pyramid is equal to $\frac 13\cdot\text{(area of base)}\cdot\text{(height)}$. The height of each pyramid must be less than $36$, since the height of each pyramid extends from $O$ to a point inside the sphere. Therefore, the volume of each pyramid is less than $12$ times the area of the base. It follows that the volume of $P$ is less than $12$ times the surface area of $P$. We can, however, make this ratio arbitrarily close to $12$ by selecting polyhedra $P$ with many small faces, so that the height of each pyramid is as close as we wish to $36$.

Therefore, for polyhedra inscribed in a sphere of radius $36$ such that the center of the sphere lies inside the polyhedron, the least upper bound on $$\frac{\text{volume of }P}{\text{surface area of }P}$$is $12$. Finally, we must consider the case of inscribed polyhedra for which the center of the sphere does not lie inside the polyhedron. However, in this case, we can still construct pyramids with apex $O$ whose bases are the faces of $P$; then the surface area of $P$ is still the sum of the areas of the bases, but the volume of $P$ is less than the total volume of the pyramids. This only strengthens the argument for an upper bound of $12$. So, the answer is $\boxed{12}$.

There are ten ways for Tina to select a pair of numbers. The sums 9, 8, 4, and 3 can be obtained in just one way, and the sums 7, 6, and 5 can each be obtained in two ways. The probability for each of Sergio's choices is $1/10$. Considering his selections in decreasing order, the total probability of Sergio's choice being greater is \begin{align*}
&\left(\frac{1}{10}\right)\left(1 + \frac{9}{10} + \frac{8}{10} +
\frac{6}{10} + \frac{4}{10} + \frac{2}{10} + \frac{1}{10} + 0 + 0 + 0
\right) \\
& = \boxed{\frac{2}{5}}.
\end{align*}

problem:
Isosceles right triangle $ABC$ encloses a semicircle of area $2\pi$. The circle has its center $O$ on hypotenuse $\overline{AB}$ and is tangent to sides $\overline{AC}$ and $\overline{BC}$. What is the area of triangle $ABC$? [asy]
pair a=(4,4), b=(0,0), c=(0,4), d=(4,0), o=(2,2);
draw(circle(o, 2));
clip(a--b--c--cycle);
draw(a--b--c--cycle);
dot(o);
label("$C$", c, NW);
label("$A$", a, NE);
label("$B$", b, SW);
[/asy]

solution:
Reflect the triangle and the semicircle across the hypotenuse $\overline{AB}$ to obtain a circle inscribed in a square. The circle has area $4\pi$. The radius of a circle with area $4\pi$ is 2. The side length of the square is 4 and the area of the square is 16. So the area of the triangle is $\boxed{8}$. [asy]
pair a=(4,4), b=(0,0), c=(0,4), d=(4,0), o=(2,2);
draw(circle(o, 2));
draw(a--d--b--c--cycle);
draw(a--b);
label("$C$", c, NW);
label("$A$", a, NE);
label("$B$", b, SW);
label("$D$", d, SE);
[/asy]

We change the order of summation: \[
\sum_{k=2}^\infty \sum_{j=2}^{2008} \frac{1}{j^k}
= \sum_{j=2}^{2008} \sum_{k=2}^\infty \frac{1}{j^k}
= \sum_{j=2}^{2008} \frac{1}{j^2(1 - \frac{1}{j})}
= \sum_{j=2}^{2008} \frac{1}{j(j-1)}
= \sum_{j=2}^{2008} \displaystyle \left( \frac 1 {j-1} - \frac 1 j \displaystyle \right)
= 1 - \frac 1 {2008}
= \boxed{\frac{2007}{2008}}.
\]

