solution:
[asy]

Label f;

f.p=fontsize(6);

xaxis(0,12, Ticks(f,2.0));

yaxis(0,12, Ticks(f,2.0));

filldraw((0,4)--(0,10)--(10,10)--(10,0)--cycle, grey);

defaultpen(linewidth(.8));

draw((0,0)--(0,10)--(10,10)--(10,0)--cycle, orange);

[/asy]

The point can be randomly selected anywhere inside the orange square, which has area $10\cdot10=100$. The point satisfies the given inequality if it lies within the shaded region (the diagonal side of the shaded region is a segment of the line $2x+5y=20$). We will find its area by subtracting the area of the non-shaded region from the area of the square. The non-shaded region is a triangle with base of length 10 and height of length 4, so its area is $\frac{10\cdot4}{2}=20$. The area of the shaded region is then $100-20=80$. So the probability that the point falls within the shaded region is $80/100=\boxed{\frac{4}{5}}$.

Suppose that $AD$ and $BC$ intersect at $E$.

[asy]
pair A,B,C,D,I;
A=(-9,-4.36);
B=(-7,7.14);
C=(8,-6);
D=(7.5,6.61);
I=(2.7,3);
draw(Circle((0,0),10));
draw(A--B--C--cycle,linewidth(0.7));
draw(B--D--C);
draw(A--D);
label("$E$",I,S);
label("$B$",B,N);
label("$D$",D,NE);
label("$C$",C,E);
label("$A$",A,SW);
[/asy]

Since $\angle ADC$ and $\angle ABC$ cut the same arc of the circumscribed circle, the Inscribed Angle Theorem implies that \[
\angle ABC= \angle ADC.
\]Also, $ \angle EAB = \angle CAD$, so $\triangle ABE$ is similar to $\triangle ADC$, and \[
\frac{AD}{CD} = \frac{AB}{BE}.
\]By the Angle Bisector Theorem, \[
\frac{BE}{EC} = \frac{AB}{AC},
\]so \[
BE = \frac{AB}{AC} \cdot EC = \frac{AB}{AC}(BC - BE)
\quad\text{and}\quad BE = \frac{AB\cdot BC}{AB+AC}.
\]Hence \[
\frac{AD}{CD} = \frac{AB}{BE} = \frac{AB+AC}{BC} =
\frac{7+8}{9} = \boxed{\frac{5}{3}}.
\]

Since $\sin \angle DBC = \frac{3}{5},$ we can assume that $CD = 3$ and $BD = 5.$  Then by Pythagoras, $BC = 4.$

[asy]
unitsize(0.5 cm);

pair A, B, C, D;

B = (0,0);
C = (4,0);
D = (4,3);
A = (4,6);

draw(A--B--C--cycle);
draw(B--D);

label("$A$", A, NE);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, E);

label("$3$", (C + D)/2, E);
label("$3$", (A + D)/2, E);
label("$4$", (B + C)/2, S);
label("$5$", interp(B,D,0.75), NW);
[/asy]

Since $D$ is the mid-point of $\overline{AC},$ $AD = 3.$  Hence,
\[\tan \angle ABC = \frac{6}{4} = \boxed{\frac{3}{2}}.\]
